In the last exercise, we saw how we could change the behaviour of a macro based on text inside the brackets. This is great, but it's basically an if statement on the text inside the brackets: it's very simplistic. Now we will introduce the concept of a "metavariable". Metavariables capture a particular part of the text inside the macro's brackets, and let you reuse it. The syntax for a metavariable is simple. To explain the syntax, see the example below: macro_rules! do_thing { (print $metavar:literal) => { println!("{}", $metavar) };
} The $metavar:literal is saying that you're capturing any literal (which is something like 'a', or 3, or "hello"), and naming it metavar. Then, $metavar inside the println! is saying to "fill in" that space with whatever metavar is. For an invocation like # macro_rules! do_thing {
# (print $metavar:literal) => {
# println!("{}", $metavar)
# };
# }
#
# fn main() {
do_thing!(print 3);
# } Rust understands that metavar means 3. So, when doing substitution, it starts by writing println!("{}", $metavar); and then substitutes 3 for $metavar: # fn main() {
println!("{}", 3);
# }

