The Rust parser needs to have some way of knowing where a metavariable ends. If it didn't, expressions like $first:expr $second:expr would be confusing to parse in some circumstances. For example, how would you parse a * b * c * d? Would first be a, and second be *b * c * d? Or would first be a * b * c, and second be * d? To avoid this problem entirely, Rust has a set of rules called the "follow-set ambiguity rules". These tell you which tokens are allowed to follow a metavariable (and which aren't). For literals, this rule is simple: anything can follow a literal metavariable. For expr (and its friend stmt) the rules are much more restrictive: they can only be followed by => or , or ;. This means that building a matcher like macro_rules! broken_macro { ($a:expr please) => $a
} fn main() { // Fails to compile! let value = broken_macro!(3 + 5 please);
} will give you this compiler error: error: `$a:expr` is followed by `please`, which is not allowed for `expr` fragments --> broken_macro.rs:2:14 |
2 | ($a:expr please) => { $a } | ^^^^^^ not allowed after `expr` fragments | = note: allowed there are: `=>`, `,` or `;` As we encounter more expression types, we'll make sure to mention their follow-set rules, but this page in the Rust reference has a comprehensive list of the rules for each fragment specifier type.

