Alternatively, you could specify two different repetitions, each containing their own metavariable. For example, this program will construct two vecs. macro_rules! two_vecs { ($($vec1:expr),+; $($vec2:expr),+) => { { let mut vec1 = Vec::new(); $(vec1.push($vec1);)+ let mut vec2 = Vec::new(); $(vec2.push($vec2);)+ (vec1, vec2) } }
} # fn main() { let vecs = two_vecs!(1, 2, 3; 'a', 'b');
# } Importantly, with the above example, you have to be careful about using $vec1 and $vec2 in the same repetition within the transcriber. It is a compiler error to use two metavariables captured a different number of times in the same repetition. To quote the reference : Each repetition in the transcriber must contain at least one metavariable to decide how many times to expand it. If multiple metavariables appear in the same repetition, they must be bound to the same number of fragments. For instance, ( $( $i:ident ),* ; $( $j:ident ),* ) => (( $( ($i,$j) ),* )) must bind the same number of $i fragments as $j fragments. This means that invoking the macro with (a, b, c; d, e, f) is legal and expands to ((a,d), (b,e), (c,f)), but (a, b, c; d, e) is illegal because it does not have the same number.

