There is one important restriction when calling a macro using another macro. When forwarding a matched fragment to another macro-by-example, matchers in the second macro will be passed an AST of the fragment type, which cannot be matched on except as a fragment of that type. The second macro can't use literal tokens to match the fragments in the matcher, only a fragment specifier of the same type. The ident, lifetime, and tt fragment types are an exception, and can be matched by literal tokens. The following illustrates this restriction: macro_rules! foo { ($l:expr) => { bar!($l); }
// ERROR: ^^ no rules expected this token in macro call
} macro_rules! bar { (3) => {}
} # fn main() {
foo!(3);
# } The following illustrates how tokens can be directly matched after matching a tt fragment: // compiles OK
macro_rules! foo { ($l:tt) => { bar!($l); }
} macro_rules! bar { (3) => {}
} # fn main() {
foo!(3);
# }

