This exercise is a sort of culmination of everything you've learned so far about macros. To complete it, you'll need to note one important fact: macros can recurse into themselves. This allows very powerful expansions. As a simple example: enum LinkedList { Node(i32, Box<LinkedList>), Empty
} macro_rules! linked_list { () => { LinkedList::Empty }; ($expr:expr $(, $exprs:expr)*) => { LinkedList::Node($expr, Box::new(linked_list!($($exprs),*))) }
} fn main() { let my_list = linked_list!(3, 4, 5);
} The above example is very typical. The first rule is the "base case": an empty list of tokens implies an empty linked list. The second rule always matches one expression first (expr). This allows us to refer to it on its own, in this case to create the Node. The rest of the expressions (exprs) are stored in a repetition, and all we'll do with them is recurse into linked_list!(). If there's no expressions left, that call to linked_list!() will give back Empty, otherwise it'll repeat the same process. While macro recursion is incredibly powerful, it is also slow. As a result, there is a limit to the amount of recursion you are allowed to do. In rustc, the limit is 128, but you can configure it with #![recursion_limit = "256"] as a crate-level attribute.

