The simplest form of macro looks like this: macro_rules! my_macro { () => { 3 }
} # fn main() {
let _value = my_macro!();
# } The macro_rules! instructs the compiler that there is a new macro you are defining. It is followed by the name of the macro, my_macro. The next line specifies a "rule". Inside the normal brackets is a "matcher" -- some text (formally, we refer to the text as "tokens") -- which Rust will use to decide which rule to execute. Inside the curly brackets is a "transcriber", which is what Rust will replace my_macro!() with. So, my_macro!() will be replaced by 3.

