Macros would be pretty useless if you couldn't modify their behaviour based on input from the programmer. To this end, let's see how we can vary what our macro does. The simplest way of doing this is to have our macro behave differently if different tokens are placed in-between the matcher. As a reminder, the matcher is the bit in each rule before the =>. Below we see a macro which will replace itself with true if the letter t is inside the brackets; and f otherwise. macro_rules! torf { (t) => { true }; (f) => { false };
}
# fn main() {
let _true = torf!(t);
let _false = torf!(f);
# } You'll note the syntax has changed slightly: we've gone from having one of the () => {} blocks (which is called a rule) to having two. Macros try to find the first rule that matches, and replaces the macro with the contents of the transcriber block. Macros are very similar to a match statement because they find the first match and take action based on that; but it's important to note that you're not matching on variables , you're matching on tokens.
